import React from "react";
import '../styles/header.css'

const Header = () => {
    return (
        <header className="header">
            <div>
                <img className="logo_1floor" alt="1floor" 
                src="imgs/logo_64.ico" />
            </div>

            <h1 style={{color: 'white'}}> Header </h1>
        </header>
    );
}

export default Header;
